import React, { useCallback, FormEvent } from 'react';
import { useDispatch } from '../../config/store';
import { navigate } from '../../pages/Services/action';

const Header = () => {
    const dispatch = useDispatch();

    const onNavigateCart = useCallback((e?: FormEvent<HTMLElement>) => {
        e && e.preventDefault();
        dispatch(navigate('Cart'));
    }, []);

    const onNavigateHome = useCallback((e?: FormEvent<HTMLElement>) => {
        e && e.preventDefault();
        dispatch(navigate('Home'));
    }, []);

    return (
        <header className="header">
            <div className="header_overlay" />
            <div className="header_content d-flex flex-row align-items-center justify-content-start">
                <div className="logo">
                    <a href="" onClick={onNavigateHome}>
                        <div className="d-flex flex-row align-items-center justify-content-start">
                            <div><img src={require("../../assets/images/logo_1.png")} alt="" /></div>
                            <div>Little Closet</div>
                        </div>
                    </a>
                </div>
                <div className="hamburger"><i className="fa fa-bars" aria-hidden="true" /></div>
                <nav className="main_nav">
                    <ul className="d-flex flex-row align-items-start justify-content-start">
                        <li className="active"><a href="#">Women</a></li>
                        <li><a href="#">Men</a></li>
                        <li><a href="#">Kids</a></li>
                        <li><a href="#">Home Deco</a></li>
                        <li><a href="#">Contact</a></li>
                    </ul>
                </nav>
                <div className="header_right d-flex flex-row align-items-center justify-content-start ml-auto">
                    <div className="header_search">
                        <form action="#" id="header_search_form">
                            <input type="text" className="search_input" placeholder="Search Item" />
                            <button className="header_search_button"><img src="~/Template/images/search.png" alt="" /></button>
                        </form>
                    </div>
                    <div className="user"><a href="#"><div><img src={require("../../assets/images/user.svg")} alt="https://www.flaticon.com/authors/freepik" /><div>1</div></div></a></div>
                    <div className="cart"><a href="" onClick={onNavigateCart}><div><img className="svg" src={require("../../assets/images/cart.svg")} alt="https://www.flaticon.com/authors/freepik" /></div></a></div>
                    <div className="header_phone d-flex flex-row align-items-center justify-content-start">
                        <div><div><img src={require("../../assets/images/phone.svg")} alt="https://www.flaticon.com/authors/freepik" /></div></div>
                        <div>+1 912-252-7350</div>
                    </div>
                </div>
            </div>
        </header>
    )
}
export default Header;
